  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0108076 includes discrete
  sample and profile data collected from AURORA AUSTRALIS in the Indian Ocean and
  Southern Oceans (> 60 degrees South) from 2004-12-23 to 2005-02-17. These data include
  CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
  (CFC-12), DISSOLVED INORGANIC CARBON (DIC), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, Potential temperature (theta), SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE,
  phosphate and silicate. The instruments used to collect these data include Alkalinity
  titrator, CTD, Coulometer for DIC measurement and bottle.nnThese data were collected
  by Bronte Tilbrook and Stephen R. Rintoul of Commonwealth Scientific and Industrial
  Research Organization as part of the CLIVAR_I09S_2004 data set. CDIAC associated
  the following cruise ID(s) with this data set: CLIVAR_I09S_2004nnThe International
  CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries out a systematic
  and global re-occupation of select WOCE/JGOFS hydrographic sections to quantify
  changes in storage and transport of heat, fresh water, carbon dioxide (CO2), and
  related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
